import React from 'react';
import { Table } from 'react-bootstrap';


export default function TagTable(props) {
    console.log(props);
    const items = props.items;
    const tagsWrapped = items.map((tag, i) => 
    <tbody key={i}>
        <tr>
            <td>
                {tag}
            </td>
        </tr>
    </tbody>
    );

    return (
        <Table striped bordered>
            <thead>
                <tr>
                    <th>Items</th>
                </tr>
            </thead>
            {tagsWrapped}

        </Table>
    );
}
